import Title from '../title';

export default function Grafic() {
  return (
    <section className="w-[100%] h-[100%] flex z-1  py-[46px]  flex-col bec">
      <Title
        title={'Aumente a Autoridade do Seu Negócio com um Site Profissional'}
      />

      <div className='grid grid-cols-2'>
        <div className='bg-white'></div>
        <div className=' grid-rows-2'>
          <div className='grid-cols-1 bg-black'></div>
          <div className='bg-slate-700'></div>
        </div>
      </div>
    </section>
  );
}
